CREATE TABLE IF NOT EXISTS "users_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "email" varchar(40) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "is_active" bool NOT NULL, "is_staff" bool NOT NULL, "date_joined" datetime NOT NULL, "phone" varchar(18) NOT NULL, "is_stylist" bool NOT NULL, "category" varchar(8) NOT NULL, "image_id" integer NULL REFERENCES "images_image" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "images_image" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "image" varchar(100) NULL, "name" varchar(200) NOT NULL, "timestamp" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "images_gallery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "updated" date NOT NULL);
CREATE TABLE IF NOT EXISTS "images_gallery_images" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "gallery_id" integer NOT NULL REFERENCES "images_gallery" ("id") DEFERRABLE INITIALLY DEFERRED, "image_id" integer NOT NULL REFERENCES "images_image" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_stylist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category" varchar(8) NOT NULL, "email" varchar(40) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "title" varchar(120) NOT NULL, "is_active" bool NOT NULL, "is_staff" bool NOT NULL, "date_joined" datetime NOT NULL, "description" varchar(200) NOT NULL, "phone" varchar(18) NOT NULL, "is_stylist" bool NOT NULL, "image_id" integer NULL REFERENCES "images_image" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "users_user" ("id") DEFERRABLE INITIALLY DEFERRED, "gallery_id" integer NULL UNIQUE REFERENCES "images_gallery" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category" varchar(7) NOT NULL, "title" varchar(100) NOT NULL, "description" varchar(200) NOT NULL, "duration" integer NOT NULL, "company" varchar(100) NOT NULL, "added" date NULL, "image_id" integer NULL REFERENCES "images_image" ("id") DEFERRABLE INITIALLY DEFERRED, "price" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "carts_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "purchased" bool NOT NULL, "purchase_date" date NOT NULL, "timestamp" datetime NOT NULL, "updated" datetime NULL, "subtotal" decimal NOT NULL, "tax_percentage" decimal NOT NULL, "tax_total" decimal NOT NULL, "total" decimal NOT NULL, "user_id" integer NULL REFERENCES "users_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "carts_cartitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL, "subtotal" decimal NOT NULL, "product_id" integer NOT NULL REFERENCES "products_variation" ("id") DEFERRABLE INITIALLY DEFERRED, "cart_id" integer NOT NULL REFERENCES "carts_cart" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_variation" ("title" varchar(120) NOT NULL, "price" decimal NOT NULL, "sale_price" decimal NULL, "inventory" integer NULL, "discount" decimal NULL, "added" date NULL, "category" varchar(7) NOT NULL, "company" varchar(100) NOT NULL, "description" varchar(200) NOT NULL, "duration" integer NOT NULL, "image_id" integer NULL REFERENCES "images_image" ("id") DEFERRABLE INITIALLY DEFERRED, "purchased_date" date NULL, "product_id" integer NOT NULL PRIMARY KEY REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "api_featurette" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "updated" date NOT NULL, "product_id" integer NULL UNIQUE REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "style_id" integer NULL UNIQUE REFERENCES "products_variation" ("product_id") DEFERRABLE INITIALLY DEFERRED, "stylist_id" integer NULL UNIQUE REFERENCES "users_stylist" ("id") DEFERRABLE INITIALLY DEFERRED);
